import React from "react";
import { useForm } from "react-hook-form";
import TextField from "@mui/material/TextField";
import OutlinedInput from "@mui/material/OutlinedInput";
import Visibility from "@mui/icons-material/Visibility";
import VisibilityOff from "@mui/icons-material/VisibilityOff";
import IconButton from "@mui/material/IconButton";
import InputAdornment from "@mui/material/InputAdornment";
import InputLabel from "@mui/material/InputLabel";
import Checkbox from "@mui/material/Checkbox";
import Button from "@mui/material/Button";

import DemoContainer from "@mui/x-date-pickers/internals/demo";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";

const App = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
    reset,
  } = useForm();

  const onSubmit = handleSubmit((data) => {
    console.log(data);
    reset();
    //fetch
  });

  return (
    <>
      <h2>Generar Reporte</h2>
      <form onSubmit={onSubmit}>
        <InputLabel htmlFor="lugar">Lugar</InputLabel>
        <OutlinedInput
          type="text"
          {...register("lugar", {
            required: {
              value: true,
              message: "El lugar es requerido",
            },
          })}
        />
        {errors.lugar && <span>{errors.lugar.message}</span>}

        <label htmlFor="fecha">Fecha</label>
        <LocalizationProvider dateAdapter={AdapterDayjs}>
          <DemoContainer components={["DatePicker"]}>
            <DatePicker label="Basic date picker" />
          </DemoContainer>
        </LocalizationProvider>
        <input
          type="date"
          {...register("fecha", {
            required: {
              value: true,
              message: "La fecha es requerida",
            },
          })}
        />
        {errors.fecha && <span>{errors.fecha.message}</span>}

        <label htmlFor="nombre">Nombre</label>
        <input
          type="text"
          {...register("nombre", {
            required: {
              value: true,
              message: "El nombre es requerido",
            },
            minLength: {
              value: 2,
              message: "El nombre debe tener al menos 2 caracteres",
            },
            maxLength: {
              value: 20,
              message: "El nombre debe tener m치ximo 20 caracteres",
            },
          })}
        />
        {errors.nombre && <span>{errors.nombre.message}</span>}

        <label htmlFor="nombreCan">Nombre del Can</label>
        <input
          type="text"
          {...register("nombreCan", {
            required: {
              value: true,
              message: "El nombre del perro es requerido",
            },
            minLength: {
              value: 2,
              message: "El nombre debe tener al menos 2 caracteres",
            },
            maxLength: {
              value: 20,
              message: "El nombre debe tener m치ximo 20 caracteres",
            },
          })}
        />
        {errors.nombreCan && <span>{errors.nombreCan.message}</span>}

        <button type="submit">Enviar</button>
      </form>
    </>
  );
};

export default App;
